import React from 'react';

import axios from 'axios';

export default class SelectPoblacio extends React.Component {
  state = {
    poblacio: []
  }

  componentDidMount() {
    axios.get(`http://localhost/projecte/poblacio.php`)
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <ul>
        { this.state.persons.map(person => <li>{person.name}</li>)}
      </ul>
    )
  }
}
